    render() {

        //Code to return a navbar with a list of all the teachers classes
        return (
            <div className="pt-2">
                <ul class="nav nav-tabs">
                    <li class="nav-item">
                        <a class="nav-link active" href="#">Class 1</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Class 2</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Class 3</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Class 4</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Class 5</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Class 6</a>
                    </li>
                </ul>
            </div>
        );
    }
}

const mapStateToProps = state => ({
    
})

export default connect()(GradeEntryClassNavBar);
